const PreviewStock = (stock) => {
    return (
        stock ? <div className='stock-preview'>
                    <p><b>Selected Stock</b></p>
                    <img src={stock.imgURL} alt={stock.name} width={'50px'} />
                    <p>{stock.name}</p>
                    <p>{stock.type}</p>
                    <p>{stock.quantity}</p>
                    <p>{stock.supplier}</p>
                </div> : <p>Searching...</p>
    )
};

export default PreviewStock;
